Actionscript.script:
if(蓄力次数<3 && _parent._name == _root.控制目标 && Key.isDown(_parent.技能按键值) == true){
	蓄力次数 += 1;
	gotoAndPlay("空间斩蓄力开始");
}

if( _parent._name == _root.控制目标 && Key.isDown(_parent.上键) == true){
	gotoAndPlay("空间斩上斩");
}

onClipEvent(load){
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战子弹";
	if(_parent._parent.刀属性.power){
		子弹属性.子弹威力 = _parent.蓄力次数 * (10 * _parent._parent.内力 + (300 + 3 * _parent._parent.内力) * (_parent._parent.技能等级 * 0.5) + _parent._parent.刀属性.power* 3 * (10 + _parent._parent.技能等级) /10);
		子弹属性.斩杀 = 2.5 + _parent.蓄力次数 * 3.5 + _parent.蓄力次数 * _parent._parent.刀属性.power/3000;
	}else{
		子弹属性.子弹威力 = _parent.蓄力次数 * (10 * _parent._parent.内力 + (300 + 3.5 * _parent._parent.内力) * (_parent._parent.技能等级 * 0.5));
		子弹属性.斩杀 = 2 + _parent.蓄力次数 * 3;
	}
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 120;
	子弹属性.击倒率 = 0.1;
	子弹属性.伤害类型 = "真伤";

	//非常用
	/*
	子弹属性.水平击退速度 = NaN;
	子弹属性.垂直击退速度 = NaN;
	子弹属性.发射效果 = "";
	子弹属性.击中地图效果 = "火花".
	子弹属性.击中后子弹的效果 = "".
	子弹属性.命中率 = NaN.
	子弹属性.固伤 = NaN;
	子弹属性.百分比伤害 = NaN;
	子弹属性.血量上限击溃 = NaN;
	子弹属性.防御粉碎 = NaN;
	*/
	子弹属性.区域定位area = this.area;
	/*
	//已初始化内容，通常不需要重复赋值，可注释掉
	子弹属性.发射者 = 子弹属性.发射者.
	子弹属性.shootX = 子弹属性.shootX;
	子弹属性.shootY = 子弹属性.shootY;
	子弹属性.shootZ = 子弹属性.shootZ;
	子弹属性.子弹敌我属性 = 子弹属性.子弹敌我属性;
	*/
	_root.子弹区域shoot传递(子弹属性);
}

